import React from "react";
import '../../style-page/Footer.css';

function Footer() {
  return (
    <div className="footer">
      <p>Связаться с нами: <a href="mailto:contact@yourwebsite.com">contact@yourwebsite.com</a></p>
    </div>
  );
}

export default Footer;
